Studio  Media Blasters 
Release Date  22 January 1977 
Category  Classic
Director  Bruno Mattei
Starring  Gabriele Carrara, Marina Daunia, Vassilli Karis, Macha Magal, Thomas Rudy, Lucic Bogoljub Benny 


After the assassination attempt of July 1944, Hitler does not trust the Wehrmacht and extends the power of the SS over Germany. General Berger entrusts Hans Schillemberg to recruit a specially chosen group of prostitutes who must test the fighting spirit and loyalty of the generals. Seedy exploitation
